        if n in memo:
            return memo[n]
        if n == 1:
            return 3
        if n % 2 == 0:
            memo[n] = 1 + n // 2
        else:
            memo[n] = helper(n - 1, memo) + helper(n - 2, memo) + helper(n + 1, memo)
        return memo[n]

    memo = {}
    result = []
    for i in range(1, n + 2):
        result.append(helper(i, memo))
    return result

def digits(n):
    product = 1
    has_odd = False
    while n > 0:
        digit = n % 10
        if digit % 2 != 0:
            product *= digit
            has_odd = True
        n //= 10
    return product if has_odd else 0

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if stack:
                stack.pop()
            else:
                return False
    # Check if there was at least one nested bracket
    return len(string) - len(stack) > 2 and not stack

