def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]
    if planet1 not in planets or planet2 not in planets:
        return ()
    index1, index2 = planets.index(planet1), planets.index(planet2)
    if index1 < index2:
        return tuple(planets[index1+1:index2])
    else:
        return tuple(planets[index2+1:index1])

def sorted_list_sum(lst):
    # Filter out strings with odd lengths
    filtered_lst = [s for s in lst if len(s) % 2 == 0]
    # Sort the list first by length and then alphabetically
    return sorted(filtered_lst, key=lambda x: (len(x), x))

import math

def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(math.sqrt(n)) + 1):
        if n % i == 0:
            return False
    return True

def x_or_y(n, x, y):
    return x if is_prime(n) else y

def even_odd_count(num):
    num_str = str(abs(num))
    even_count = sum(1 for digit in num_str if int(digit) % 2 == 0)
    odd_count = sum(1 for digit in num_str if int(digit) % 2 != 0)
    return (even_count, odd_count)

def right_angle_triangle(a, b, c):
    sides = sorted([a, b, c])
    return sides[0]**2 + sides[1]**2 == sides[2]**2

def find_max(words):
    max_unique = 0
    result = ""
    for word in words:
        unique_chars = len(set(word))
        if unique_chars > max_unique or (unique_chars == max_unique and word < result):
            max_unique = unique_chars
            result = word
    return result

def do_algebra(operator, operand):
    expression = str(operand[0])
    for i in range(len(operator)):
        expression += " " + operator[i] + " " + str(operand[i + 1])
    return eval(expression)

def solve(s):
    if not any(char.isalpha() for char in s):
        return s[::-1]
    else:
        return ''.join(char.swapcase() if char.isalpha() else char for char in s)

def string_to_md5(text):
    import hashlib
    if text == "":
        return None
    md5_hash = hashlib.md5(text.encode())
    return md5_hash.hexdigest()
